import React from "react";
import Container from "../components/Container";
import Heading from "../components/Heading";
import Card from "../components/Card";
import Button from "../components/Button";
import backIcon from "../assets/backIcon.svg";
import { theme } from "../theme";
import { Flex, Text, Link, Image } from "rebass";

const ResourcePageReplacement = () => {
  return (
    <Container>
      <Link href="/" margin="25px">
        <Button variant="primary">
          <Image src={backIcon} height={25} width={25} marginRight="1px" />
        </Button>
      </Link>
      <Flex width="100%" flexDirection="column">
        <Heading marginLeft="25px">Resources</Heading>
      </Flex>

      <Flex width="100%" justifyContent="center">
        <Card bg={theme.colors.gainsboro} cornerRadius="10px">
          Hello
        </Card>
      </Flex>
    </Container>
  );
};

export default ResourcePageReplacement;
